{'id': '4966884161088437903', 'known_neuron_data': {'description': 'We propose that the ICP Maximalist Network neuron should be renamed to the **Synapse.Vote** neuron. A synapse is a site of communication between neurons in the nervous system, which seems like an appropriate metaphor. While the voting members and the general mission of the ICPMN neuron are not changing, this rebranding will establish it as a separate organization. All of the voting members of the neuron have collaborated on this transition and see it as a positive change for ICPMN and the IC as a whole.

Our manifesto and voting members are listed on our website [Synapse.vote](https://www.synapse.vote/). You are invited to follow the new Synapse neuron on [Twitter](https://twitter.com/SynapseVote) and join the conversation on [Telegram](https://t.me/synapsevote).
 ', 'name': 'Synapse.vote (formerly ICP Maximalist Network)'}}
